import * as React from 'react';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

const Icons = () => {
  return (
    <div className='icons'>
      <FontAwesomeIcon icon='fa-brands fa-github'/>
      <FontAwesomeIcon icon='fa-brands fa-linkedin'/>
    </div>
  );
}

export default Icons;
